    false,nt"url": null,nt"notes": "This annual narrative report for Blackwater
    National Wildlife Refuge outlines Refuge accomplishments during the 1982 calendar
    year. The report begins with a summary of the year's highlights and weather conditions.
    Land acquisition is covered. The report includes a planning section which discusses
    the master plan, the management plan, compliance with environmental and cultural
    resource mandates, and research and investigations. Refuge administration is outlined;
    information about personnel, youth programs, manpower programs, volunteer programs,
    funding, safety, and technical assistance is given. Habitat management is also covered;
    subjects include wetlands, forests, croplands, haying, fire management, and pest
    control. The wildlife section of the report discusses endangered and threatened
    species, waterfowl, marsh birds and waterbirds, shorebirds, raptors, game mammals,
    surplus animal disposal, animal control, marking and banding, and disease control.
    The public uses of the Refuge described in this report include outdoor classrooms,
    interpretive programs, fishing, wildlife observation, and law enforcement. The equipment
    and facilities section of the report provides information about new construction,
    rehabilitation, major maintenance, equipment replacement, communication systems,
    and energy conservation. Cooperative programs and items of interest are provided
    at the end.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
